import { ReactElement } from "react";

export enum PageIds {
  Organizers = "organizers",
  Speakers = "speakers",
  Schedule = "schedule",
  CFP = "cfp",
}
export interface Organizer {
  name: string;
  description: string;
  img: string;
  webpage: string;
  affliation: string;
}

export interface CFP {
  description: string;
  themes: string[];
  format: string;
  dates: {
    date: string | ReactElement;
    type: "submission" | "notification" | "workshop";
  }[];
  submit: {
    name: string;
    url: string;
  };
}

export interface ProgramCommittee {
  name: string;
  affiliation: string;
}

export interface Schedule {
  start: string;
  end: string;
  theme: string;
  description: string;
}

export interface Metadata {
  organizers: Organizer[];
  cfp: CFP;
  pcs: ProgramCommittee[];
}
